import React from "react";
import { Link, useNavigate } from "react-router-dom"
import './product.css';

const Product = () => {
    const navigate = useNavigate();
    return (
        <div>
            <h1>
                Product Page
            </h1>
            <form>
                <fieldset>
                    <label>
                        <p>ABS Product P/N</p>
                        <input name = "ABS"/>
                        <p>Old ABS Product P/N</p>
                        <input name = "OldABS"/>
                    </label>
                </fieldset>
                
            </form>
            




            <button onClick={() => navigate(-1)}>Home</button>
        </div>
    );
};

export default Product;
